    public class Objects : BaseScript
    {
	    public static List<ObjectData> ObjectList = new List<ObjectData>();
	    public static List<ObjectDeleteData> ObjectDeleteList = new List<ObjectDeleteData>();
	    public static float LoadRange = 400f;
	    public static int Count = 0;

		public static async void CreateObject(Model model, Vector3 position, Vector3 rotation, bool dynamic, bool placeOnGround) 
		{
			//CreateObject(model, position, rotation, dynamic, placeOnGround);
			ObjectData objData = new ObjectData
			{
				model = model,
				pos = position,
				rot = rotation,
				dynamic = dynamic,
				placeOnGround = placeOnGround,
				isCreate = false
			};
			ObjectList.Add(objData);
			Count = ObjectList.Count;
			
			/*if (!IsModelValid((uint) model.Hash)) 
				return;
			
			if (!await Main.LoadModel((uint) model.Hash))
				return;*/
		}

	    public static void DeleteObject(Model hash, float x, float y, float z) 
	    {
		    ObjectDeleteData objData = new ObjectDeleteData
		    {
			    hash = (uint) hash.Hash,
			    x = x,
			    y = y,
			    z = z
		    };
		    ObjectDeleteList.Add(objData);
	    }
	    
	    public Objects()
	    {
		    Tick += DrawObjects;
	    }
	    
	    private static async Task DrawObjects()
	    {
		    await Delay(10000);
		    var pos = GetEntityCoords(GetPlayerPed(-1), true);
		    
		    var entity = GetClosestObjectOfType(461.8065f, -994.4086f, 25.06443f, 1.0f, 631614199, false, false, false);
		    FreezeEntityPosition(entity, true);
		    entity = GetClosestObjectOfType(461.8065f, -997.6583f, 25.06443f, 1.0f, 631614199, false, false, false);
		    FreezeEntityPosition(entity, true);
		    entity = GetClosestObjectOfType(461.8065f, -1001.302f, 25.06443f, 1.0f, 631614199, false, false, false);
		    FreezeEntityPosition(entity, true);

		    entity = GetClosestObjectOfType(1273.816f, -1720.697f, 54.92143f, 1.0f, 1145337974, false, false, false);
		    FreezeEntityPosition(entity, true);

		    entity = GetClosestObjectOfType(1972.769f, 3815.366f, 33.66326f, 1.0f, 132154435, false, false, false);
		    FreezeEntityPosition(entity, true);
		    
		    SetStateOfClosestDoorOfType((uint) 2271212864, -440.9874f, 6012.765f, 31.86633f, true, 0, false);
		    SetStateOfClosestDoorOfType((uint) 2271212864, -442.8268f, 6010.925f, 31.86633f, true, 0, false);
		    SetStateOfClosestDoorOfType((uint) 2271212864, -447.7092f, 6006.717f, 31.86633f, true, 0, false);
		    SetStateOfClosestDoorOfType((uint) 2271212864, -449.5486f, 6008.556f, 31.86633f, true, 0, false);

		    if (ObjectList.Count > 0)
		    {
			    foreach (var item in ObjectList)
			    {
				    if (item == null)
					    continue;
				    
				    if (Main.GetDistanceToSquared(pos, item.pos) > LoadRange)
				    {
					    if (item.isCreate)
					    {
						    if (item.prop == null) continue;
						    try
						    {
							    item.prop.Delete();
							    item.prop = null;
							    item.isCreate = false;
						    }
						    catch (Exception e)
						    {
							    Debug.WriteLine("DELETE OBJECT1: " + e.ToString());
						    }
					    }
				    }
				    else
				    {
					    if (!item.isCreate)
					    {
						    if (item.prop != null) continue;
						    
						    try
						    {
								item.prop = await CreateObjectLocally(item.model, item.pos, item.rot, item.dynamic);
								if (item.prop == null)
								{
									item.prop = null;
									item.isCreate = false;
									continue;
								}
								/*if (Convert.ToInt64(item.prop.Model.Hash) == 0)
								{
									item.prop.Delete();
									item.prop = null;
									item.isCreate = false;
									continue;
								}*/
							    
							    SetEntityAsMissionEntity(item.prop.Handle, true, true);

							    if (!item.dynamic)
								    item.prop.IsPositionFrozen = true;

							    item.prop.LodDistance = 400;
							    
							    if (item.placeOnGround)
							    {
								    item.prop.HasGravity = true;
								    item.prop.ApplyForce(item.pos + new Vector3(0, 0, 0.1f), new Vector3(), ForceType.ForceNoRot);
							    }
						    
							    item.isCreate = true;
						    }
						    catch (Exception e)
						    {
							    Debug.WriteLine($"ERROR CREATE OBJECT: {Convert.ToInt64(item.model)}|{item.pos.X}|{item.pos.Y}|{item.pos.Z}|{e}");
						    }
					    }
					    else
					    {
						    if (item.prop == null) continue;
						    if (!item.prop.IsDead) continue;	
						    
						    try
						    {
							    item.prop.Delete();
							    item.prop = null;
							    item.isCreate = false;
						    }
						    catch (Exception e)
						    {
							    Debug.WriteLine("DELETE OBJECT1: " + e.ToString());
						    }
					    }
				    }
			    } 
		    }
		    
		    new Prop(GetClosestObjectOfType(-440.9874f, 6012.765f, 31.86633f, 1f, 2271212864, false, false, false)).Delete();
		    new Prop(GetClosestObjectOfType(-442.8268f, 6010.925f, 31.86633f, 1f, 2271212864, false, false, false)).Delete();
		    new Prop(GetClosestObjectOfType(-447.7092f, 6006.717f, 31.86633f, 1f, 2271212864, false, false, false)).Delete();
		    new Prop(GetClosestObjectOfType(-449.5486f, 6008.556f, 31.86633f, 1f, 2271212864, false, false, false)).Delete();
		    
		    foreach (var item in ObjectDeleteList)
			    new Prop(GetClosestObjectOfType(item.x, item.y, item.z, 2f, item.hash, false, false, false)).Delete();
	    }

		public static async Task<Prop> CreateObjectLocally(Model model, Vector3 position, Vector3 rotation, bool dynamic)
		{
			if (!IsModelValid((uint) model.Hash))
				return null;
			if (!await Main.LoadModel((uint) model.Hash))
				return null;
			return new Prop(CreateObjectNoOffset((uint) model.Hash, position.X, position.Y, position.Z, false, true, dynamic)) { Rotation = rotation };
		}

